import React from 'react';
import gellery from '../../images/mobile/image-gallery-cone.jpg';

const GalleryItems = ({desktop, mobile}) => {

  return (
    <picture>
        <source media='(min-width : 768px)' srcSet={desktop}/>
        <img src={gellery} alt="gallery image"/>
    </picture>
  )
}

export default GalleryItems
